import Models from "../db/models";
const {feedbacks} = Models;
import {v4 as uuidv4 } from 'uuid';
class FeedbackController{
    static async receivefeedbacks(req, res){
        try {
            const {useid,message}=req.body
            const Myuuid=uuidv4();
            const ReceiveMessage = await feedbacks.create({
                id:Myuuid,
                useid,
                message
            })
            return res.status(200).json({
                status:200,
                message:"message send",
                data:ReceiveMessage
            })
        } catch (error) {
            return res.status(500).json({
                status:500,
                message:"Server Problem"+error.message
            })
            
        }
    }
}

export default FeedbackController

