const {sectors}=Models;
class SectorsController{
    static async getSectorsBydistrictId(req,res){
        try {
            const ModelId=req.params.id
            const findSectors= await sectors.findOne({
                where:{DistrictId:ModelId}
            })
            if(findSectors){
                return res.status(200).json({
                    responceCode:200,
                    status:"success",
                    data:findSectors
                })
            }
                return res.status(400).json({
                    responceCode:400,
                    status:"failed",
                    message:"Sector not found"
                })

        } catch (error) {
            return res.status(500).json({
                responceCode:500,
                status:"failed",
                error:error.message
            })
        }
    }
}
export default SectorsController

