import Models from"../db/models";
const {villages}=Models;

class VillageController{
    static async getVillagesBycellId(req,res){
        try {
            const modelId = req.params.id;
            const findVillage= await villages.findOne({
                where:{ CellId:modelId}
            })
            if(findVillage){
                return res.status(200).json({
                    responseCode:200,
                    status:"success",
                    data:findVillage
                })
            }
            return res.status(400).json({
                responseCode:400,
                status:"failed",
                message:"village not Found"
            })
            
        } catch (error) {
            return res.status(500).json({
                responseCode:500,
                status:"failed",
                error:error.message
            })
            
        }
    }
}
export default VillageController

